import React from "React";


export default function Units(props){
    return(
        <div class ="units">  
                <a href = "index.js" id = "celcius"> C </a> 
                <h2>{props.Celcius} | </h2>
                <a href = "#" id = "farenheit"> {props.Farenheit}</a>
            </div>
    )
}
